import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import DownloaderForm from "./components/DownloaderForm";
import FAQ from "./components/FAQ";
import Contact from "./components/Contact";
import "./App.css";

const TABS = [
  { id: "instagram", label: "Instagram" },
  { id: "youtube", label: "YouTube" },
];

const IG_TYPES = [
  { id: "auto", label: "All (Reels/Posts/IGTV)" },
  { id: "reel", label: "Reels" },
  { id: "post", label: "Post (Photo/Video)" },
  { id: "igtv", label: "IGTV" },
  { id: "carousel", label: "Carousel (first item only)" },
];

const YT_TYPES = [
  { id: "auto", label: "All (Shorts/Live/Long)" },
  { id: "shorts", label: "Shorts" },
  { id: "live", label: "Live (if available)" },
  { id: "long", label: "Long Video" },
];

export default function App() {
  const [platform, setPlatform] = useState("instagram");
  const [igType, setIgType] = useState("auto");
  const [ytType, setYtType] = useState("auto");
  const [previewUrl, setPreviewUrl] = useState("");
  const [previewFormat, setPreviewFormat] = useState("");
  const [previewUsername, setPreviewUsername] = useState("");

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div className="app">
              <header className="nav">
                <div className="brand">
                  <img src="/logo.svg" className="logo" alt="InstantSaver" />
                  <span>InstantSaver</span>
                </div>
                <nav className="links">
                  <a href="#features">Features</a>
                  <a href="#faq">FAQ</a>
                  <a href="/contact">Contact</a>
                </nav>
              </header>

              <section className="hero">
                <h1>Online Video Downloader</h1>
                <p>
                  Download Instagram Reels/Posts & YouTube Shorts/Live/Long —
                  fast, free, no login.
                </p>

                <div className="tabs">
                  {TABS.map((t) => (
                    <button
                      key={t.id}
                      className={`tab ${platform === t.id ? "active" : ""}`}
                      onClick={() => setPlatform(t.id)}
                    >
                      {t.label}
                    </button>
                  ))}
                </div>

                {platform === "instagram" && (
                  <div className="subtabs">
                    {IG_TYPES.map((t) => (
                      <button
                        key={t.id}
                        className={`subtab ${igType === t.id ? "active" : ""}`}
                        onClick={() => setIgType(t.id)}
                      >
                        {t.label}
                      </button>
                    ))}
                  </div>
                )}

                {platform === "youtube" && (
                  <div className="subtabs">
                    {YT_TYPES.map((t) => (
                      <button
                        key={t.id}
                        className={`subtab ${ytType === t.id ? "active" : ""}`}
                        onClick={() => setYtType(t.id)}
                      >
                        {t.label}
                      </button>
                    ))}
                  </div>
                )}

                <DownloaderForm
                  platform={platform}
                  igType={igType}
                  ytType={ytType}
                  setPreviewUrl={setPreviewUrl}
                  setPreviewFormat={setPreviewFormat}
                  setPreviewUsername={setPreviewUsername}
                />

                {previewUrl && (
                  <div className="preview">
                    <h3>Preview</h3>
                    {platform === "instagram" && previewUsername && (
                      <p className="username">Posted by @{previewUsername}</p>
                    )}
                    <video
                      controls
                      width="100%"
                      style={{ borderRadius: "12px", marginTop: "15px" }}
                    >
                      <source
                        src={previewUrl}
                        type={`video/${previewFormat || "mp4"}`}
                      />
                      Your browser does not support the video tag.
                    </video>
                  </div>
                )}
              </section>

              <section id="features" className="features">
                <h2>Everything in one place</h2>
                <div className="feature-grid">
                  <div className="card">
                    <h3>Fast & Smart</h3>
                    <p>
                      High-speed processing backed by optimized pipelines to
                      preview & download instantly.
                    </p>
                  </div>
                  <div className="card">
                    <h3>Free to Use</h3>
                    <p>
                      No signup. No paywall. Just paste your link, preview, and
                      download.
                    </p>
                  </div>
                  <div className="card">
                    <h3>Unlimited</h3>
                    <p>Use it as much as you like. No hidden limits.</p>
                  </div>
                </div>
              </section>

              <FAQ />

              <footer className="footer">
                <div className="footer-brand">
                  <img src="/logo.svg" className="logo small" alt="InstantSaver" />
                  <strong>InstantSaver</strong>
                </div>
                <p>© {new Date().getFullYear()} InstantSaver. All rights reserved.</p>
                <p className="disclaimer">
                  Disclaimer: All logos and trademarks belong to their respective
                  owners. Downloads are fetched directly from public CDNs. Please
                  respect platform terms.
                </p>
              </footer>
            </div>
          }
        />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}
